import React from "react";


const CardPricingTable = (props) =>{
    return (
        <div className="pricing-box">
            <div className="pricing-header">
                <h2>{props.oferta}</h2>
                <h3 className="packeg_p">
                    <span>{prop}$</span>
                </h3>
                <p>monthly</p>
                {/*/.pricing-header*/}
                <ul className="plan-lists">
                <li>{props.user}</li>
                <li>01 project</li>
                <li>01 advisor team</li>
                <li>complete statistics</li>
                <li>E-Mail support</li>
                </ul>
                {/*/ul*/}
                <div className="project-btn pricing-btn text-center">
                <a href="project.html" className="project-view">
                    Sign Up Now
                </a>
                </div>
                {/*/.project-btn*/}
            </div>
            {/*/.pricing-box*/}
        </div>
    )
}
export default CardPricingTable;
